import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
constructor() {
  super();

  this.state = {
    monsters: [
      {
        name: 'The Shape',
        id: '1'

      },
      {
        name: 'Dracula',
        id: '2'

      },
      {
        name: 'Wolfman',
        id: '3'

      }
    ] 
  };
}


render() {
    return (
      <div className='App'>
      {
        this.state.monsters.map(monster => <h1 key={monster.id}>{ monster.name }</h1>)
      }
      </div>
    )
  }
}

export default App;
